import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import "./Artifacts.css";

const Artifacts = () => {
  return (
    <div className="artifacts-page">
      <Header />
      <section className="artifacts-content">
        <h1>Artifacts Collection</h1>
        <p>Explore a wide collection of 3D artifacts from Portsmouth and Newport, RI.</p>
        {/* You can add a grid or list of artifacts here */}
      </section>
      <Footer />
    </div>
  );
};

export default Artifacts;
